`std::floor()` is a function in the C++ Standard Library that returns the largest integer less than or equal to a given value.

In other words, it rounds down a floating-point number to the nearest whole number. For example:

* `std::floor(3.7)` would return 3
* `std::floor(-3.7)` would return -4

This function is part of the `<cmath>` header file and takes one argument: a single precision (float), double precision (double), or long double value.

The function prototype is:
```c++
#include <cmath>

double floor(double arg);
```
You can use this function like so:
```cpp
#include <iostream>
#include <cmath>

int main()
{
    double x = 4.9;

    // Returns the largest integer less than or equal to x
    int result = std::floor(x);

    std::cout << "Floor of " << x << ": " << result << '\n';

    return 0;
}
// Outputs: Floor of 4.9: 4
```

