Creating a GUI library from scratch is a complex task that requires a deep understanding of graphics, event handling, and operating system-specific details. However, I'll provide a basic, minimalistic C99 GUI library to get you started. Keep in mind that this implementation will be simplified and might not cover all edge cases.

** Warning: This library is not intended for production use and should be considered experimental. **

The library will be called `minigui`. It will support:

1. Creating windows
2. Drawing rectangles and text
3. Handling keyboard and mouse events
4. Basic window management (focus, close)

Let's start with the header file (`minigui.h`):
```c
