```solidity
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v4.5.0/contracts/access/Ownable.sol";

contract LendingContract {
    // Mapping of lenders to their deposited ETH balances
    mapping (address => uint256) public lenderBalances;

    // Mapping of borrowers to their borrowed ETH amounts
    mapping (address => uint256) public borrowerBorrows;

    // Mapping of loans to their interest rates
    mapping (bytes32 => uint256) public loanInterestRates;

    // Event emitted when a deposit is made
    event Deposit(address indexed lender, uint256 amount);

    // Event emitted when a loan is taken out
    event Borrow(address indexed borrower, uint256 amount);

    // Event emitted when a loan is repaid
    event Repay(address indexed borrower, uint256 amount);

    // Owner of the contract
    address private owner;

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the contract owner can call this function.");
        _;
    }

    constructor() public {
        owner = msg.sender;
    }

    // Function to deposit ETH into the contract
    function deposit() public payable {
        require(msg.value > 0, "Deposit amount must be greater than zero.");

        // Increment the lender's balance by the deposited amount
        lenderBalances[msg.sender] += msg.value;

        emit Deposit(msg.sender, msg.value);
    }

    // Function to borrow ETH from the contract
    function borrow(uint256 _amount) public {
        require(_amount > 0, "Borrow amount must be greater than zero.");

        // Check if there is sufficient balance available for borrowing
        uint256 totalBalance = 0;
        for (uint256 i = 0; i < lenderBalances.length; i++) {
            totalBalance += lenderBalances[keccak256(i)];
        }
        require(totalBalance >= _amount, "Insufficient balance available for borrowing.");

        // Decrement the contract's balance by the borrowed amount
        borrowerBorrows[msg.sender] += _amount;

        // Calculate the interest rate for the loan
        uint256 interestRate = calculateInterestRate(_amount);

        loanInterestRates[keccak256(_amount)] = interestRate;

        emit Borrow(msg.sender, _amount);
    }

    // Function to repay a loan
    function repay(uint256 _amount) public {
        require(_amount > 0, "Repay amount must be greater than zero.");

        // Check if the borrower has an outstanding loan
        require(borrowerBorrows[msg.sender] > 0, "No outstanding loan to repay.");

        // Decrement the borrower's borrowed balance by the repaid amount
        borrowerBorrows[msg.sender] -= _amount;

        // Increment the lender's balance by the repaid amount plus interest
        lenderBalances[msg.sender] += _amount + (calculateInterestRate(_amount) * _amount / 100);

        emit Repay(msg.sender, _amount);
    }

    // Function to calculate the interest rate for a loan
