In Vue 3, you can set a default value for a prop using the `default` property on the component's props definition.

Here is an example of how to do it:

```javascript
// MyComponent.vue
export default {
  props: {
    title: {
      type: String,
      default: 'Hello World!' // Set the default value here
    }
  }
}
```

Alternatively, if you want to set a function as the default value (for example to return an object or array), you can use a function as the value for the `default` property:

```javascript
// MyComponent.vue
export default {
  props: {
    settings: {
      type: Object,
      default() {
        return { foo: 'bar' } // Return an object as the default value
      }
    }
  }
}
```

Note that when you define a default value as a function, the function will be called once at startup, and its return value will be cached and reused every time the component instance is created.

Also worth noting is that in Nuxt 3 (which uses Composition API) you would achieve the same thing like so:

```typescript
// MyComponent.vue
export default {
  props: defineProps({
    title: {
      type: String,
      default: 'Hello World!'
    }
  })
}
```

or 

```typescript
// MyComponent.vue
export default {
  setup(props) {
    const { title = "Hello World!" } = toRefs(props);
  },
});
```
