```cpp
#include <iostream>
#include <stdexcept>

/**
 * Calculate the surface area and volume of a cube.
 *
 * @param side_length The length of a side of the cube.
 * @return std::pair{surface_area, volume}
 */
std::pair<double, double> cube_properties(double side_length) {
    if (side_length <= 0) {
        throw std::invalid_argument("Side length must be a positive number.");
    }

    // The surface area of a cube is 6 times the square of the length of a side
    double surface_area = 6 * side_length * side_length;

    // The volume of a cube is the cube of the length of a side
    double volume = side_length * side_length * side_length;

    return {surface_area, volume};
}

int main() {
    try {
        double side_length = 5.0; // define the length of a side of the cube
        auto [area, volume] = cube_properties(side_length);
        std::cout << "For a cube with side length " << side_length << ":\n";
        std::cout << "Surface Area: " << area << "\nVolume: " << volume << '\n';
    } catch (const std::exception& e) {
        std::cerr << "Exception caught: " << e.what() << '\n';
    }
    return 0;
}
```

This function `cube_properties` calculates the surface area and volume of a cube given its side length. It first checks if the provided side length is valid (i.e., it should be greater than zero). If not, an `std::invalid_argument` exception is thrown. Otherwise, it computes the surface area (which equals 6 times the square of the length of a side) and the volume (which equals the cube of the length of a side).

Example usage can be seen in the provided `main` function where the properties for a cube with a side length of `5` units are calculated and printed out.

Note that error handling is included to ensure robustness against invalid input.

**Edmonds-Karp Algorithm Implementation**
======================================

The Edmonds-Karp algorithm is an implementation of the Ford-Fulkerson method for computing the maximum flow in a flow network. Here's a high-quality, readable, and well-documented C++ implementation:

```cpp
#include <iostream>
#include <queue>
#include <vector>

// Structure to represent a graph edge
struct Edge {
    int v; // Destination vertex
    int capacity; // Maximum capacity
    int flow; // Current flow
};

class Graph {
public:
    Graph(int vertices) : V(vertices), adj(vertices) {}

    void addEdge(int u, int v, int capacity) {
        adj[u].emplace_back(v, capacity);
        adj[v].emplace_back(u, 0); // Add reverse edge with 0 capacity
    }

    int maxFlow(int s, int t) {
        int result = 0;
        while (bfs(s, t)) {
            // Find augmenting paths and update flows
            for (int i = 1; i <= V; ++i)
                resCapacity[i] = INT_MAX;

            queue<int> q;
            q.push(t);

            while (!q.empty()) {
                int u = q.front();
                q.pop();

                for (auto& e : adj[u]) {
                    if (e.v!= s && e.flow > 0) { // Check if it's not source and has residual capacity
                        int minCapacity = std::min(resCapacity[e.v], e.flow);
                        resCapacity[u] = minCapacity;
                        q.push(e.v);
                    }
                }
            }

            // Update residual capacities
            int path_flow = resCapacity[t];
            if (path_flow > 0) {
                result += path_flow;

                int current_node = t;
                while (current_node!= s) {
                    for (auto& e : adj[current_node])
                        if (resCapacity[current_node] == std::min(resCapacity[e.v], e.flow)) {
                            int next_node = e.v;

                            e.flow -= path_flow; // Subtract flow from forward edge
                            if (next_node!= s)
                                adj[next_node][std::find(adj[next_node].begin(), adj[next_node].end(), current_node) - adj[next_node].begin()].flow += path_flow;

                            current_node = next_node;
                            break;
                        }
                }
            } else
                break; // Stop when no augmenting path found
        }

        return result;
    }

private:
    int V; // Number of vertices
    std::vector<std::vector<Edge>> adj; // Adjacency list representation
    std::vector<int> resCapacity; // Residual capacities

    bool bfs(int s, int t) {
        std::vector<bool> visited(V + 1, false);
        std::queue<int> q;

        visited[s] = true;
        q.push(s);

        while (!q.empty()) {
            int u = q.front();
            q.pop();

            for (const auto& neighbor : adj[u]) {
                int v = neighbor.v;
                int capacity = neighbor.capacity;
                int flow = neighbor.flow;

                if (!visited[v] && (capacity - flow) > 0) {
                    visited[v] = true;
                    parent[v] = u;

                    if (v == t)
                        return true;

                    q.push(v);
                }
            }
        }

        return false;
    }

    std::vector<int> parent; // For BFS tree construction
};
```

