// Create connection
$conn = new mysqli($servername, $username, $password, $dbname);

if ($conn->connect_error) {
    die("Connection failed: ". $conn->connect_error);
}

class AccountingSystem {
    private $dbConnection;

    function __construct($connection) {
        $this->dbConnection = $connection;
    }

    function createAccount($accountName, $accountType) {
        $query = "INSERT INTO accounts (account_name, type) VALUES (?,?)";
        $stmt = $this->dbConnection->prepare($query);
        $stmt->bind_param("ss", $accountName, $accountType);
        return $stmt->execute();
    }

    function logTransaction($accountId, $journalId, $value, $entryType) {
        if (!$accountId ||!$journalId ||!$value ||!$entryType) {
            echo "Missing parameters.\n";
            return false;
        }
        $query = "INSERT INTO transactions (journal_id, account_id, value, entry_type)
                  VALUES (?,?,?,?)";
        $stmt = $this->dbConnection->prepare($query);
        $stmt->bind_param("iiid", $journalId, $accountId, $value, $entryType);
        return $stmt->execute();
    }

    function generateIncomeStatement() {
        // Simpler example - actual implementation would involve complex logic based on account types (revenue & expenses).
        $revenues = $expenses =
